import { StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.nav}>
        <Text>Accessories</Text>
        <Text>User</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,

  },
  nav:{

    flexDirection:'row',
    height:'10%',
    width:'100%',
    backgroundColor:'blue',
    textAlign:'center',
    alignItems:'center',
    margin:'10px'

  }
});
